import React from 'react';

class Profile extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          dataFetched: false,
          data: []
        };
      }
      
      componentDidMount() {
        fetch("http://api.github.com/users/Milad121?client_id=6911d4269bc4f6ddf233&client_secret=3feaf5064fe244b800c467ac21dbe4c9b111a85a&sort=created")
          .then(res => res.json())
          .then(
            (response) => {
              this.setState({
                dataFetched: true,
                data: response.data
              });
            },
            (error) => {
              this.setState({
                dataFetched: true,
                error
              });
            }
          )
      }
      
      render() {
        const { error, dataFetched, data } = this.state;
